import styled from "styled-components"

export const Container = styled.button`
    width: ${props.whidt};

    background: #2f5d62;
    color: #f5f5f5;
    height: 45px;
    border-radius: 8px;
    border: 2px solid var(--green);
    font-family: "Roboto Mono", monospace;
    margin-top: 16px;
    :hover{
        border:2px solid var(--orange)
    }
`;
